pragma solidity >= 0.5.0 < 0.7.0;
pragma experimental ABIEncoderV2;

contract AnchorContract {

    struct AnchorHash {
        string newHash;
        string lastHash;
    }

    struct AnchorValue {
        AnchorHash hash;
        string DigitalProof;
        string ZKPValue;
    }

    // store all anchors
    AnchorValue[] anchorStorage;
    //keep a mapping between anchor(keySSI) and it's versions
    mapping (string => uint[]) anchorVersions;




    constructor() public {

    }

    function addAnchor(string memory anchor, string memory newHash, string memory lastHash, string memory digitalProof, string memory ZKPValue) public {
            //create new anchor value
            AnchorValue memory anchorValue = buildAnchorValue(newHash,lastHash,digitalProof,ZKPValue);
            anchorStorage.push(anchorValue);
            uint versionIndex = anchorStorage.length - 1;
        //update number of versions available for that anchor
            anchorVersions[anchor].push(versionIndex);
    }

    function buildAnchorValue(string memory newHash, string memory lastHash, string memory digitalProof, string memory ZKPValue) private pure returns (AnchorValue memory){
        AnchorHash memory anchorHash = AnchorHash(newHash, lastHash);
        return AnchorValue(anchorHash, digitalProof, ZKPValue);
    }

    function copyAnchorValue(AnchorValue memory anchorValue) private pure returns (AnchorValue memory){
        return buildAnchorValue(anchorValue.hash.newHash, anchorValue.hash.lastHash, anchorValue.DigitalProof, anchorValue.ZKPValue);
    }

    function getAnchorVersions(string memory anchor) public view returns (AnchorValue[] memory) {
        if (anchorVersions[anchor].length == 0)
        {
            return new AnchorValue[](0);
        }
        uint[] memory indexList = anchorVersions[anchor];
        AnchorValue[] memory result = new AnchorValue[] (indexList.length);
        for (uint i=0;i<indexList.length;i++){
            result[i] = copyAnchorValue(anchorStorage[indexList[i]]);
        }

        return result;
    }
//    function anchorExits (string anchor)
//    {
 //       return anchorVersions[anchor].length != 0;
  //  }
}
